package com.ecs.bcp.service.ejb;


import java.io.ByteArrayInputStream;
import java.util.Base64;
import java.util.List;

import com.itextpdf.kernel.pdf.PdfDocument;
import com.itextpdf.kernel.pdf.PdfReader;
import com.itextpdf.signatures.SignatureUtil;
/**
 * @author VISWANTH KANNAIYAN
 */

public class PdfSignatureChecker {

    public static boolean isSignaturePresent(String base64Pdf) {
        try {
            // Decode the Base64 encoded PDF
            byte[] pdfBytes = Base64.getDecoder().decode(base64Pdf);

            // Create a PdfDocument instance
            PdfDocument pdfDocument = new PdfDocument(new PdfReader(new ByteArrayInputStream(pdfBytes)));

            // Create a SignatureUtil instance
            SignatureUtil signatureUtil = new SignatureUtil(pdfDocument);

            // Get a list of signature names
            List<String> signatures = signatureUtil.getSignatureNames();

            // Check if there are any signatures
            return !signatures.isEmpty();
        } catch (Exception e) {
            e.printStackTrace();
            return false;
        }
    }

    public static void main(String[] args) {
        // Example Base64 encoded PDF string
        String base64Pdf = "";

        boolean hasSignature = isSignaturePresent(base64Pdf);

        if (hasSignature) {
            System.out.println("The PDF contains a digital signature.");
        } else {
            System.out.println("The PDF does not contain a digital signature.");
        }
    }
}